import React from 'react';
import '../hamburgers.css';

const Navbar = () => {

    return (<div className='Navbar'>
        <button class="hamburger hamburger--vortex" type="button">
            <span class="hamburger-box">
                <span class="hamburger-inner"></span>
            </span>
        </button>
        </div>)
}

export default Navbar
